import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Find a specific product card to click. Using a combination of class and text content for robustness.
    const productCardSelector = '.product-card:has-text("Sony WH-1000XM5")';
    await page.waitForSelector(productCardSelector, { timeout: 5000 });

    // Click the product card to open the modal
    await page.locator(productCardSelector).click();
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_after_click.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_after_click.png'));

    // Wait for the modal to become visible. The modal's style changes to 'display: block'.
    const modalSelector = 'div[style*="display: block"] .product-detail-title';
    await page.waitForSelector(modalSelector, { timeout: 5000 });

    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_modal_visible.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_modal_visible.png'));

    // Extract the product title from the modal to verify it opened correctly
    const productTitle = await page.locator(modalSelector).textContent();

    return {
      success: true,
      action: "Opened the product detail modal for 'Sony WH-1000XM5'.",
      extractedData: {
        modalProductTitle: productTitle
      },
      screenshots,
      error: null
    };
  } catch (error) {
    // Take a screenshot on error
    const errorScreenshots = [];
    try {
        const errorScreenshotPath = path.join(screenshotsDir, 'error_screenshot.png');
        await page.screenshot({ path: errorScreenshotPath });
        errorScreenshots.push(errorScreenshotPath);
    } catch (e) {
        console.error("Failed to take error screenshot:", e);
    }

    return {
      success: false,
      action: "Failed to open product detail modal",
      extractedData: {},
      screenshots: errorScreenshots,
      error: error.message
    };
  }
}
